import React from 'react';
import './App.css';
import Navbar from './components/Navbar';
import Home from './components/pages/Home';
import Login from './components/pages/Login';
import AdminHomepage from './components/pages/AdminHomepage';
import ViewAllSubscribers from './components/pages/ViewAllSubscribers';
import ViewSelectedUser from './components/pages/ViewSelectedUser';
import UpdateUser from './components/pages/UpdateUser';
import Register from './components/pages/AddUser';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom';


function App() {
  return (
  <>
  <Router>
    <Navbar/>
    <Switch>
      <Route path='/' exact component={Home}/>
      <Route path="/login"  component={Login} />
      <Route path="/register"  component={Register} />
      <Route path="/mainHomePage" exact  component={AdminHomepage} />
      <Route path="/viewAllSusbscriver" exact  component={ViewAllSubscribers} />
      <Route path="/viewSelectedUser/:id" exact component={ViewSelectedUser} />
      <Route path="/updateUser/:id" exact component={UpdateUser} />


    </Switch>
  </Router>
  </>
  );
}

export default App;
